ok, so i'm really getting fed up with this whole summer in michigan. if things don't look up soon i'm going to accidentally fall off my balcony. maybe lying in traction at a hospital will be more fun than sitting at the computer all day doing nothing. i am so fucking bored and i'm getting angry at my family. it's like they really hate me, or are hiding something from me. i also think i'm going crazy, but that's beside the point. the point is, i'm whining and i should stop because i'm being annoying.

